import Manifest from './s1-thewhat.json'

const SplitPara = () => {
    var text = Manifest[0].paragraph
    return(
    <div>
        {text.split('/n').map((i,key) => {
            return <div key={key}>{i}</div>;
            })}
        </div>
    )
}

const TheWhat = () => { 
    return (
    <div className='flex flex-col text-black p-10 space-y-8'>
        <div className='font-extrabold text-2xl'>Our purpose.</div>
        <div className='font-normal text-base leading- space-y-6'>
            <SplitPara />
        </div>
    </div>
    )
}

export default TheWhat
